options.css:
div {
    font-family: Inter, Helvetica, Arial, sans-serif;
}
.container {
    text-align: center;
    width: 100%;
}

.title {
    /*border: 2px solid grey;*/
    border-radius: 25px;
    width: 70%;
    display: inline-block;
    padding: 10px;
    font-size: 25px;
    color: rgb(50, 50, 50);
    background-color: rgb(220, 220, 220);
}

.fixed {
    width: 200px;
    height: 180px;
    display: inline-block;
    margin: 50px;
    /*border: 2px solid grey;*/
    box-shadow: 0px 0px 3px 3px rgb(238, 237, 237) inset;

    border-radius: 25px;
    line-height: 180px;
    font-size: 20px;
    color: rgb(88, 88, 88);
}

.fixed span {
    background-color: rgba(255, 255,255, 0.8);
    border-radius: 10px;
}

.met-table {
     background-image: url("https://storage.googleapis.com/sheerwater-public/grafana_table_icon.png");
     background-size: cover;
    background-color: rgba(255,255,255,0.7);
    background-blend-mode: lighten;

}
.met-map {
     background-image: url("https://storage.googleapis.com/sheerwater-public/grafana_map_icon.png");
    background-size: cover;
    background-color: rgba(255,255,255,0.6);
    background-blend-mode: lighten;
}
